import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import TodoItem from "./components/TodoItem";

class App extends Component {
  constructor () {
super();
this.todoItems = [
  "Đi đá bóng",
  "Đi chơi",
  "Đi đổ xăng"
]
  }
  render() {
    return (
      <div className="App">
        <TodoItem title="Đi đá bóng" />
        <TodoItem title="Đi chơi" />
        <TodoItem title="Đi đổ xăng" />
      </div>
    );
  }
}

export default App;
